const canvas = document.getElementById('canvas1');
// pass the id that is in the index.html file
const ctx = canvas.getContext('2d');
// ctx is short for context. This makes ctx an instance of 2d api object. We can now call all canvas built in methods on this variable. Example: Being able to call ctx rectangle to create a rectangle, etc.
canvas.width = 400;
canvas.height = 400;
// Need to be same dimensions as the dimensions in our style.css file.

const image1 = new Image();

// new is a special keyword in JavaScript.
// Image is a special built-in class constructor.
// Doing this creates a new blank object. We can now assign it values and properties based on built in JavaScript image blue print. In other words, we have created a blank new image object that comes with src property.
// If you console.log() image1, you should see it.

// image1.src = '/Users/evan/Documents/memeTemplates/poop-emoji.jpg';

image1.src = 'data:image/png;base64,';

// ctx.drawImage(image1, 0, 0);

// First argument represents the image you want to draw.
// Second argument represents X coordinate.
// Third argument represents Y coordinate.

//At this point when opening index.html with Chrome, you will not see an image even with the drawImage method. We have to take variable image1, and since we gave it the src attribute on the line below it, we can give it an event listener or load event.

// image1.addEventListener('load', function(){
//   ctx.drawImage(image1, 0, 0);
// });

// The drawImage method can actually take in 5 arguments. The 4th and 5th argument can be width and height of the image, respectively:

// image1.addEventListener('load', function(){
//   ctx.drawImage(image1, 0, 0, canvas.width, canvas.height);
// });

// The third version of the drawImage method takes in 9 arguments. You can use it to crop out pieces of a sprite sheet.

// There is a built-in method within Canvas that can show us all the colors in the image we would like to use.

image1.addEventListener('load', function(){
  const canvas = document.getElementById('canvas1');
  ctx.drawImage(image1, 0, 0, canvas.width, canvas.height);
  const scannedImage = ctx.getImageData(0, 0, canvas.width, canvas.height);
  // console.log(scannedImage);

  const scannedData = scannedImage.data;
  for (let i = 0; i < scannedData.length; i += 4){
    const total = scannedData[i] + scannedData[i+1] + scannedData[i+2];
    const averageColorValue = total/3;
    scannedData[i] = averageColorValue;
    scannedData[i+1] = averageColorValue;
    scannedData[i+2] = averageColorValue;

    let particlesArray = [];
    const numberOfParticles = 5000;

    class Particle {
      constructor(){
        this.x = Math.random() * canvas.width;
        this.y = 0;
        this.speed = 0;
        this.velocity = Math.random() * 3.5;
        this.size = Math.random() * 1.5 + 1;
      }
      update(){
        this.y += this.velocity;
        if (this.y >= canvas.height){
            this.y = 0;
            this.x = Math.random() * canvas.width;
        }
      }
      draw(){
        ctx.beginPath();
        ctx.fillStyle = 'white';
        ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
        ctx.fill();
      }
    }

  }
  // scannedImage.data = scannedData;
  // ctx.putImageData(scannedImage, 0, 0);
  function init(){
    for (let i = 0; i < numberOfParticles; i++){
      particlesArray.push(new Particle);
    }
  }
  init();

  function animate(){
    ctx.globalAlpha = 0,05;
    ctx.fillStyle = 'rgb(0, 0, 0)';
    ctx.fillRect(0, 0, canvas.width, canvas.height);
    for (let i = 0; i < particlesArray.length; i++){
      particlesArray[i].update();
      particlesArray[i].draw();
    }
    requestAnimationFrame(animate);
  }
  animate();

});

